package finished.No438_找到字符串中所有字母异位词;

import java.util.ArrayList;
import java.util.Arrays;
import java.util.List;

/**
 * created by henryxiao 2019年6月7日
 * 
 */
public class Solution {

	public static void main(String[] args) {
		Solution solution = new Solution();
		String s = "";
		String p = "";
		long startTime = System.currentTimeMillis();
		List<Integer> list = solution.findAnagrams(s, p);
		System.out.println(list.toString());
		long endTime = System.currentTimeMillis();
		System.out.println("findAnagrams程序运行时间： " + (endTime - startTime) + "ms");
		
		long startTime1 = System.currentTimeMillis();
		List<Integer> list1 = solution.findAnagrams_1(s, p);
		System.out.println(list.toString());
		long endTime1 = System.currentTimeMillis();
		System.out.println("findAnagrams_1程序运行时间： " + (endTime1 - startTime1) + "ms");
	}


	public List<Integer> findAnagrams(String s, String p) {
		List<Integer> list = new ArrayList<>();

		char[] cp = p.toCharArray();
		Arrays.sort(cp);

		int len2 = cp.length;
		for (int i = 0; i < s.length() - len2 + 1; i++) {
			String b = s.substring(i, len2 + i);
			char[] cb = b.toCharArray();
			Arrays.sort(cb);
			if (Arrays.equals(cp, cb)) {
				list.add(i);
			}
		}
		return list;
	}
	public List<Integer> findAnagrams_1(String s, String p) {
		List<Integer> list = new ArrayList<>();

		char[] cp = p.toCharArray();
		char[] cs =s.toCharArray();
		int[] is=new int[26];
		int[] ip=new int[26];

		for (int i = 0; i < cp.length; i++) {
			char c=cp[i];
			ip[c-'a']++;
		}
		for (int i = 0; i < s.length(); i++) {
			if (i>=p.length()) {
				is[cs[i-p.length()]-'a']--;
			}
			is[cs[i]-'a']++;
			if (Arrays.equals(is, ip)) {
				list.add(i-p.length()+1);
			}
		}
		return list;
	}
}
